import React, {Component} from "react";
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import skinCAM from '/static/skinCAM.png';
import {FontAwesomeIcon} from "@fortawesome/react-fontawesome";
import {faClipboardList, faHammer, faHome, faNewspaper} from "@fortawesome/free-solid-svg-icons";

const projects = [
    {
        title: 'skinCAM',
        description: 'hi',
        image: skinCAM
    }
];


class GlobalNavbar extends Component {
    render() {
        return <Navbar className="nbar">
            <Navbar.Brand href="#home">
                <div id="profile-image-container">
                    <img
                        id="profile-image"
                        alt=""
                        src="/logo.svg"
                        width="30"
                        height="30"
                        className="d-inline-block align-top"
                    />{' '}
                </div>
            </Navbar.Brand>
            <p className='nm'>hbg</p>
            <Navbar.Collapse className='navbar-links'>
                <Nav className="ml-auto">
                    <Nav.Link href="#">
                        <FontAwesomeIcon icon={faHome}/>
                    </Nav.Link>
                    <Nav.Link href="#">
                        <FontAwesomeIcon icon={faHammer}/>
                    </Nav.Link>
                    <Nav.Link href="#">
                        <FontAwesomeIcon icon={faClipboardList}/>
                    </Nav.Link>
                    <Nav.Link href="#">
                        <FontAwesomeIcon icon={faNewspaper}/>
                    </Nav.Link>
                </Nav>
            </Navbar.Collapse>

        </Navbar>
    }
}

class ColoredButton extends Component {
    render() {
        return <Button variant="primary" style={{backgroundColor: this.props.color || 'red'}}>{this.props.text}</Button>
    };
};

class ProjectCard extends Component {
    render() {
        return <Col sm={6}>
            <Card>
                <Card.Img variant="top"
                          src={this.props.image || 'https://cdn1.thr.com/sites/default/files/imagecache/landscape_928x523/2019/11/the_mandalorian_still_embed.jpg'}/>
                <Card.Body>
                    <Card.Title>{this.props.title || 'Card Title'}</Card.Title>
                    <Card.Text>
                        {this.props.description || 'A sample description.'}
                    </Card.Text>
                    <Button variant="primary">Go somewhere</Button>
                </Card.Body>
            </Card>
        </Col>
    };
};

class ProjectList extends Component {
    render() {
        return (
            <Row>
                {projects.map((value, index) => {
                    return <ProjectCard title={value.title} text={value.description} image={value.image}/>;
                })}
            </Row>
        )
    }
}

export {ProjectCard, ColoredButton, GlobalNavbar, ProjectList};
